import "./app.css"
import { BrowserRouter, Route, Routes} from "react-router-dom";

import Home from "./home"



function App() {
  return (

    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="about" element={<div> About Page</div>} />

      </Routes>
    </BrowserRouter>

  );
}

export default App;
